import React from "react";
import { Segment, Transition } from "semantic-ui-react";
import DropDown from "./DropDown";
const Place_Definer = ({ Card_Inform, visible, OnClosed, OnSumbit }) => {
  return (
    <Transition visible={visible} animation="fade up" duration={1200}>
      <div
        style={{
          position: "absolute",
          // left: "50%",
          bottom: "0%",
          width: "100%"
        }}
      >
        <div className="ui segment">
          <form className="ui form">
            <label>Shop Name</label>
            <div className="two fields">
              <div class="field">
                <input type="text" name="Shop Name" />
              </div>
              <div class="field">
                <div class="ui fluid search selection dropdown">
                  <input type="hidden" name="country" />
                  <i class="dropdown icon"></i>
                  <div class="menu">
                    <div class="default text">Select Country</div>
                    <div class="item" data-value="restr">
                      Restaurant
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </form>
        </div>
      </div>
    </Transition>
  );
};

export default Place_Definer;
